import './App.scss';

function App() {
  return (
    <div className="App">
      <video id="background-video" autoPlay loop muted type="video/mp4">
        <source src="canoe-video.mp4" />
        Sorry this video is unavailable
      </video>
      <div className="navbar">
        <img src="logo.png" />
        <ul className="list-action">
          <li>Notre mission</li>
          <li>Les activités</li>
          <li>Les rivières</li>
          <li>Réservations</li>
          <li>Nous contacter</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
